create database administracion;
use administracion;

create table clientes (
	id_cliente INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	nombre VARCHAR(50),
	apellido VARCHAR(50),
	direccion VARCHAR(50),
	telefono VARCHAR(50),
	email VARCHAR(50),
	fecha_alta DATE
);

create table detallespedidos (
	id_pedido INT,
	codigo_producto VARCHAR(50),
	cantidad VARCHAR(50),
	precio_venta DECIMAL(5,2)
);

create table pedidos (
	id_pedido INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
	descripcion VARCHAR(50),
	id_cliente INT,
	fecha_compra DATE,
	fecha_entrega DATE,
	descuento DECIMAL(4,2)
);


create table productos (
	codigo INT AUTO_INCREMENT PRIMARY KEY,
	producto VARCHAR(50),
	descripcion VARCHAR(50),
	precio_compra DECIMAL(5,2)
);










/* 1. Listar para el cliente nro. 1 todos los pedidos realizados, indicando: el id, descripción, 
fecha de compra y fecha de entrega del pedido y los códigos de productos incluidos en el pedido. */
select pedidos.id_pedido, pedidos.descripcion, pedidos.fecha_compra, pedidos.fecha_entrega, detalleproducto.codigo_producto
from pedidos 
inner join detallepedido on detallepedido.id_pedido = pedidos.id_pedido
where id_cliente = 1;


/* 2. Listar todos los pedidos de todos los clientes, indicando id cliente, nombre y apellido, id pedido y descripción de pedido. */
select clientes.id_cliente, clientes.nombre, clientes.apellido, pedidos.id_pedido, pedido.descripcion 
from clientes 
inner join pedidos on pedidos.id_cliente = clientes.id_cliente;


/* 3. Listar el detalle de los pedidos de los clientes. Incluir los siguientes datos en el listado: Del cliente: id, nombre, apellido. 
Del pedido: id, descripción Detalle del pedido: código de producto y cantidad. */
select clientes.id_cliente, clientes.nombre, clientes.apellido, pedidos.id_pedido,
pedido.descripcion, detallepedidos.codigo_producto, detallepedido.cantidad
from clientes 
inner join pedidos on pedidos.id_cliente = clientes.id_cliente
inner join detallespedidos on detallespedidos.id_pedido = pedidos.id_pedido;


/* 4. Listar los clientes que aún no hayan realizado pedidos */
select * from clientes 
where id_cliente 
not in (select id_cliente from pedidos);


/* 5. Clientes que no hayan hecho pedidos (mediante una subconsulta) */
select * from clientes 
where id_cliente 
not in (select id_cliente from pedidos);


/* 6. Listar el detalle de los pedidos cuyo descuento haya sido del 5% */
select * from detallepedido where id_pedido in (select id_pedido from pedidos where descuento = 5);


/* 7. Listar el/los pedidos con mayor descuento realizado */
select * from detallepedido where id_pedido in (select id_pedido from pedidos where descuento in (select max(descuento) from pedidos));

/* 8. Listar el/los pedidos con menor descuento realizado */
select * from detallepedido where id_pedido in (select id_pedido from pedidos where descuento in (select min(descuento) from pedidos));

/* 9. Listar los clientes que hayan realizado pedidos */
select * from clientes where id_cliente in (select id_cliente from pedidos);

/* 10. Listar cuantos tipos de articulos se realizan por pedido */
select id_pedido, count(codigo_producto)
from detallespedidos
group by id_pedido;


/* 11. Listar los pedidos que que tengan mas de 3 articulos por pedido */
select id_pedido, count(codigo_producto) as countowo
from detallespedidos
group by id_pedido
having countowo > 3;

/*select id_pedido, (select count(*) from detallepedido where detallespedido.id_pedido = pedidos.id_pedido) as Count from pedidos where
(select count(*) from detallepedido where detallespedido.id_pedido = pedidos.id_pedido) > 3; */


/* 12. Listar la cantidad de días desde la fecha de compra hasta la fecha de entrega por c/u de los pedidos */
select datediff(day, fecha_compra, fecha_entrega) as relevo
from pedidos;

/* 13. Listar los clientes con mas de 10 años de antigüedad */
select * from clientes where datediff(year, fecha_alta, GETDATE()) > 10;

/* 14. Listar para cada pedido el valor total de la compra */
select pedidos.*, detallepedidos.precio_venta
from pedidos
inner join detallepedidos on detallepedidos.id_pedido = pedidos.id_pedido
group by pedidos.id_pedido;

/* 15. Listar los pedidos cuyo monto supere los $ 3500 */
select pedidos.*, detallepedidos.precio_venta
from pedidos
inner join detallepedidos on detallepedidos.id_pedido = pedidos.id_pedido
where detallepedidos.precio_venta > 3.500
group by pedidos.id_pedido;

/* 16.  Listar la cantidad de productos vendidos por codigo de producto*/
select codigo_producto, cantidad
from detallepedidos
group by codigo_producto;


/* 17. Listar el/los codigos de producto de mayor valor */
select codigo_producto from detallepedido 
where precio_venta in (select max(precio_venta) 
from detallepedido);


/* 18. a. En uno muestre la máxima, minima y promedio de unidades incluidas en un pedido. */
select avg(cantidad), min(cantidad), max(cantidad) from detallepedidos group by id_pedido;


/* b. En el otro la cantidad máxima, minima y promedio de tipos de producto diferentes incluidos en un pedido. */
select avg(cantidad), min(cantidad), max(cantidad) from detallepedidos group by codigo_producto;


/* 19. Liste los nombres de los clientes que hayan realizado una compra por un valor total mayor a $3.000 */
select clientes.nombre
from clientes 
inner join pedidos on pedidos.id_cliente = clientes.id_cliente
inner join detallespedidos on detallespedidos.id_pedido = pedidos.id_pedido
where detallespedidos.precio_venta > 3500;


